import React from "react";
import Button2 from "../../../components/Button2";
import MindMaster from "../../../assets/images/MindMaster.png";
import { faArrowRight } from "@fortawesome/free-solid-svg-icons";

const BestSellers = () => {
  return (
    <section className="padding-x flex flex-col xl:flex-row justify-center items-center gap-32 w-full">
      <div className="flex flex-col gap-6 justify-center items-start">
        <h1 className="text-4xl font-bold text-balance text-start">
          Check out our best sellers
        </h1>
        <Button2 label="Explore our products" icon={faArrowRight} />
      </div>
      <div>
        <img src={MindMaster} alt="MindMaster" />
      </div>
    </section>
  );
};

export default BestSellers;
